            <tr>Tag</tr>
            <tr>Método de pagamento</tr>
            <tr>Valor</tr>
            <tr>Moeda</tr>
            <tr>Câmbio utilizado</tr>
            <tr>Valor convertido</tr>
            <tr>Moeda de conversão</tr>
            <tr>Editar/Excluir</tr>
          </thead>
        </table>
      </div>
    );
  }
}

export default Table;
